import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Navbar extends Component {

  render() {
    return (
      <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
        <Link to="/" className="navbar-brand">ExcerTracker</Link>
        <div className="collpase navbar-collapse">
        <ul className="navbar-nav mr-auto">
        <li className="navbar-item">
        <Link to="/directlogin" className="nav-link">login</Link>
        </li>
          <li className="navbar-item">
          <Link to="/task/users/id" className="nav-link">Exercises</Link>
          </li>
          <li className="navbar-item">
          <Link to="/create/users/id" className="nav-link">Create Exercise Log</Link>
          </li>
          <li className="navbar-item">
          <Link to="/user" className="nav-link">Create User</Link>
          </li>
          <li>
          <Link to="/directlogin" className="nav-link">logout</Link>
          </li>
        </ul>
        </div>
      </nav>
    );
  }
}
